<!-- tooltip end -->
<p>
  <code>Traversable</code> 인터페이스는 내부 엔진 인터페이스이므로 PHP 스크립트에서 구현될 수 없습니다. 자세한 내용은 <a href="https://www.php.net/manual/en/class.traversable.php">The Traversable interface (php.net)</a>(을)를 참고하세요.
